import React from 'react'
import './useForm.css'

const useForm = (props) => {
  return (
    <div>
      <h4>{props.title}</h4>
      <p>{props.subtitle}</p>
      <label>{props.label}</label>
      <input {...props.input} />

    </div>
  )
}

export default useForm
